from typing import List, Any


def filter_integers(values: List[Any]) -> List[int]:
    """ Filter given list of any python values only for integers
    >>> filter_integers(['a', 3.14, 5])
    [5]
    >>> filter_integers([1, 2, 3, 'abc', {}, []])
    [1, 2, 3]
    """
    if values:
        return filter(lambda x: isinstance(x, int), values)

from typing import List, Any


def filter_integers(values: List[Any]) -> List[int]:
    """ Filter given list of any python values only for integers
    >>> filter_integers(['a', 3.14, 5])
    [5]
    >>> filter_integers([1, 2, 3, 'abc', {}, []])
    [1, 2, 3]
    """
    if not values:
        return []

    integers = []
    for value in values:
        if isinstance(value, int):
            integers.append(value)
        elif isinstance(value, str) and value.isdigit():
            integers.append(int(value))
        elif isinstance(value, dict) and isinstance(value.values()[0], int):
            integers.append(value.values()[0])
        elif isinstance(value, list) and all(isinstance(element, int) for element in value):
            integers.append(value)

    return integers

from typing import List, Any


def filter_integers(values: List[Any]) -> List[int]:
    """ Filter given list of any python values only for integers
    >>> filter_integers(['a', 3.14, 5])
    [5]
    >>> filter_integers([1, 2, 3, 'abc', {}, []])
    [1, 2, 3]
    """
    for value in values:
        if isinstance(value, int):
            yield value
        elif isinstance(value, dict):
            yield value
        elif isinstance(value, list):
            yield from filter_integers(value)

from typing import List, Any


def filter_integers(values: List[Any]) -> List[int]:
    """ Filter given list of any python values only for integers
    >>> filter_integers(['a', 3.14, 5])
    [5]
    >>> filter_integers([1, 2, 3, 'abc', {}, []])
    [1, 2, 3]
    """

    def to_int(val) -> int:
        try:
            return int(val)
        except ValueError:
            return None

    return [
        to_int(v) if isinstance(v, int) else None for v in values
    ]

from typing import List, Any


def filter_integers(values: List[Any]) -> List[int]:
    """ Filter given list of any python values only for integers
    >>> filter_integers(['a', 3.14, 5])
    [5]
    >>> filter_integers([1, 2, 3, 'abc', {}, []])
    [1, 2, 3]
    """
    for item in values:
        if not isinstance(item, int):
            values.remove(item)
    return list(filter(lambda x: x is not None, values))
